import React, { Component } from 'react'
import { connect } from 'react-redux'

class Friends extends Component {
    myFunction = () => {
        this.props.onclick();
    }
    HomePage = () => (
        <div id="fb">
        <img src="/images/bean1.jpg"  alt="Image of woman" />
        <p id="info"><b>Natalie G.</b> <br /> <span>14 mutual friends</span></p>
        <div id="button-block">
            <div id="confirm">Confirm</div>
            <div id="delete">Delete Request</div>
        </div>
    </div>
    );
    render() {

        const user = this.props.user;
        console.log('inside friend user', user);
        return (
            <div class="dropdown">
            <i onClick={this.myFunction} className="fas fa-user-friends fa-lg"></i>
                <div id="myDropdown" class="dropdown-content">
                <this.HomePage />
                </div>
            </div>

        )
    }
}


const mapStateToProps = (state) => {
    return {
        user: state.user,
    };
}

export default connect(mapStateToProps)(Friends);
